import React from "react";
import CharacterCard from "./components/CharacterCards"

function App() {
  return (
    <CharacterCard name="Spongebob Squarepants" image="https://vignette.wikia.nocookie.net/spongebobgalaxy/images/0/07/SpongeBob_SquarePants.png/revision/latest?cb=20171228024014" occupation="Fry Cook" location="Pinapple"></CharacterCard>
  );
}

export default App;
